import { ReactComponent as Logo } from '../assets/react-logo.svg'

function NavBar() {
    return (
        <div id="container">
            <section>
                <Logo width="40px" />
            </section>

            <section id="info">
                <span>Price</span>
                <span>About</span>
                <span>Privacy</span>
            </section>
        </div>
    );
}

export default NavBar
